measurements.description:
Thirteen slightly cupped flowers on one 68-cm arching inflorescence;

sepals obovate, yellow speckled burgundy;
petals eliptical, yellow, speckled burgundy, burgundy midrib;

lip white overlaid burgundy reverse, marked burgundy heavily apical third, center burgundy stripe, sparsely spotted burgundy proximal two-thirds, densely speckled burgundy mid-lobe edges,
 keels yellow spotted burgundy;


column yellow, overlaid burgundy, spotted burgundy ventral surface, anther cap white;
substance firm; texture matte.
